tables.table_schema:
CREATE TABLE ProteinInteractions (id INT PRIMARY KEY,
protein_name VARCHAR(255) NOT NULL,
drug_name VARCHAR(255) NOT NULL,
interaction_type VARCHAR(100) NOT NULL
);

CREATE TABLE DrugTargets (id INT PRIMARY KEY,
drug_name VARCHAR(255) NOT NULL,
target_protein VARCHAR(255) NOT NULL,
effectiveness VARCHAR(100)
);

CREATE TABLE ProteinAnnotations (
    protein_id UUID PRIMARY KEY,
    gene_name VARCHAR(50),
    molecular_weight FLOAT,
    function_description TEXT
);

CREATE TABLE DrugInteractions (
    drug_id UUID PRIMARY KEY,
    protein_id UUID,
    interaction_type VARCHAR(50),
    affinity_score FLOAT
);

CREATE TABLE protein_interactions (
    protein_id INT PRIMARY KEY,
    protein_name TEXT,
    interaction_partner_id INT,
    interaction_type TEXT
);

CREATE TABLE drug_compounds (
    compound_id INT PRIMARY KEY,
    compound_name TEXT,
    target_protein_id INT,
    compound_structure TEXT
);

CREATE TABLE drug_trials (
    trial_id INT PRIMARY KEY,
    trial_name TEXT,
    drug_compound_id INT,
    trial_phase TEXT
);

CREATE TABLE drug_effects (
    effect_id INT PRIMARY KEY,
    effect_name TEXT,
    drug_compound_id INT,
    effect_description TEXT
);

CREATE TABLE Protein_Compounds (
    protein_id INT PRIMARY KEY,
    compound_id INT NOT NULL,
    interaction_type VARCHAR(20) NOT NULL
);

CREATE TABLE Protein_Network (
    network_id INT PRIMARY KEY,
    protein_id INT NOT NULL,
    interaction_partner_id INT NOT NULL,
    interaction_strength FLOAT
);

CREATE TABLE Compounds (
    compound_id INT PRIMARY KEY,
    compound_name VARCHAR(50) NOT NULL,
    chemical_structure TEXT
);

CREATE TABLE Protein (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(50) NOT NULL,
    protein_type VARCHAR(50) NOT NULL
);

CREATE TABLE Drug_Discovery (
    discovery_id INT PRIMARY KEY,
    compound_id INT NOT NULL,
    protein_id INT NOT NULL,
    discovery_date DATE
);
